import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import sdata from  './sdata';
import './index.css';





ReactDOM.render(
  <>
  <h1 className="heading_style">list of top 5 seris</h1>
    {sdata.map((val) => {
      return (
             <Card 
               imgsrc = {val.imgsrc}
               title  = {val.title}
               stitle = {val.stitle}
               link   = {val.link}
              />
              )
    })}
  </>
  ,document.getElementById('root')
);
